import { createTheme } from "@mui/material"
import { palette } from "./palette"
import { typography } from "./typography"

export const theme = createTheme()

theme.typography.h1 = {
  ...typography.variants.title1,
}
theme.typography.h2 = {
  ...typography.variants.title2,
}
theme.typography.h3 = {
  ...typography.variants.title3,
}
